import React from 'react';
import { Button, Container } from 'semantic-ui-react';
import { Link } from 'react-router-dom';

const NavBar = ({ history, currentUser, logout, signUp }) => {
  const authButtons = (
    <Container text textAlign='justified'>
      <Button floated inverted color='red' >
        Search
      </Button>

      <Button inverted color='red' >
        Profile
      </Button>

      <Button  inverted color='red' onClick={logout}>
        Logout
      </Button>
    </Container>
  );

  const guestButtons = (
    <Container>
      <Button  inverted color='red' to={'/login'}>
        Login
      </Button>

      <Button  to={'/signup'} inverted color='red'>
        SignUp
      </Button>
    </Container>
  );

  return <>{currentUser ? authButtons : guestButtons}</>;
};
export default NavBar;
